$(document).ready(function(){function parseNodes(children){var ul=document.createElement("ul");for(var i=0;i<children.length;i++){ul.appendChild(parseNode(children[i]))}return ul}function parseNode(node){var li=document.createElement("li");var a=document.createElement("a");li.appendChild(a);a.innerHTML=node.text;a.className=node.class;if(node.url!=""){a.href=node.url}if(node.children){var span=document.createElement("span");if($(".site-body").length===0){span.className="glyphicon glyphicon-chevron-right"}else{span.className="glyphicon"}a.appendChild(span);li.appendChild(parseNodes(node.children))}return li}var result=parseNodes(toc);result.setAttribute("class","toc nav nav-site-sidebar");$("#toc-standalone-placeholder").replaceWith(result);var level=$("#topic-content > .section").attr("data-topic-level");var prefix="";for(var i=1;i<level;i++){prefix+="../"}$("ul.toc li a, ul.section-toc li a").each(function(e){var thislink=typeof $(this).attr("href")!=="undefined"?$(this).attr("href"):"";thislink!==""?$(this).attr("href",prefix+decodeURI(thislink)):""});$(document).trigger("toc.ready")});
